text:
台灣藝術家涂維政挺進荷蘭國家博物館！
與代表處共用館舍辦公的 #臺灣文化中心(簡稱 #巴文中心
)，不只負責台法文化交流，同時也推動與瑞士、荷蘭、比利時、盧森堡、摩納哥、安道爾及列支敦士登等歐洲國家在視覺藝術、表演藝術、文學出版、文創設計、影視、音樂等多元領域的合作，推展臺灣文化軟實力，擔任臺灣與歐洲文化交流平臺，在強化臺灣實質外交的國際網絡上，扮演關鍵角色，請大家多多支持並分享巴文中心的活動喔！

Jusqu'où les fake news iront-elles se nicher? Une fausse version de cette photo
circule, dans laquelle la calligraphie du fond est remplacée par une autre... de
